Biodiversidade, ou diversidade biológica, pode ser definida como a variabilidade entre os seres vivos de todas as origens, a terrestre, a marinha e outros ecossistemas aquáticos e os complexos ecológicos dos quais fazem parte. Essa variabilidade aparece apenas como resultado da natureza em si, sem sofrer intervenção humana. Assim, ela pode variar de acordo com as diferentes regiões ecológicas. Refere-se, portanto, à variedade de vida no planeta Terra, incluindo a variedade genética dentro das populações e espécies, a variedade de espécies da flora, da fauna, de fungos microscópicos e de micro-organismos. Pode-se compreender, do termo "conservação", a manutenção dos recursos que constituem a terra, bem como os seres vivos que a compõem, dentre eles, o homem. Difere-se da preservação (que exclui o fator humano para que seja possível a manutenção supracitada), considerando que o homem, principal responsável pela degradação do meio ambiente, é parte dele. Em ecologia, a conservação se refere aos estudos direcionados à conservação de fauna e flora de um ambiente, podendo ser à respeito de diversos grupos ou direcionado à espécies individuais envolvendo seu nicho e habitat. Ela se baseia em alguns pressupostos, incluindo que a diversidade biológica e a evolução são positivas, e que a diversidade biológica tem valor por si só. A diversidade biológica, mesmo sem que haja ação antrópica, não se mantém inalterada ao longo do tempo, ela muda e se adapta de acordo com as variações do ambiente que a compõe. No entanto, as ações antrópicas podem agravar alguns problemas ambientais, como a alteração e perda de habitats, exploração predatória de recursos, introdução de espécies exóticas em diferentes ecossistemas, aumento de patógenos e tóxicos ambientais e as mudanças climáticas. Essa área de estudo tem como seus principais objetivos entender os efeitos dessas ações antrópicas no ecossistema, além de também apresentar um papel muito importante na reintrodução de espécies ameaçadas. Um ambiente ecologicamente conservado proporciona uma diversidade de recursos muito maior para ser consumida, assim, a busca de um ecossistema equilibrado é vantajosa para todos os seres que dele usufruem direta ou indiretamente. A biodiversidade refere-se tanto ao número de diferentes categorias biológicas quanto à abundância relativa (equitatividade) dessas categorias. E inclui variabilidade ao nível local, complementaridade biológica entre habitats e variabilidade entre paisagens. Ela inclui, assim, a totalidade dos recursos vivos, ou biológicos, e dos recursos genéticos, e seus componentes. A espécie humana depende da biodiversidade para a sua sobrevivência. A biologia de conservação busca integrar políticas de conservação com as teorias que provêm de diversos campos científicos que dão alicerce para a biologia da conservação, sendo elas, ecologia, demografia, biologia populacional, genética, taxonomia e também de ciências de outros campos, como a economia, geografia, antropologia, sociologia e outras. Essa união ocorre para que haja o estabelecimento de métodos efetivos para solucionar alguns dos problemas que a biologia da conservação precisa resolver. Um exemplo da importância dessa interdisciplinaridade é a implementação de unidades de conservação, que abrange muitos fatores além dos ecológicos, como o fator sociocultural dos moradores das regiões que são implementadas como tais unidades. O termo foi criado por Thomas Lovejoy, mas não há uma definição consensual de biodiversidade. Uma definição é: "medida da diversidade relativa entre organismos presentes em diferentes ecossistemas". Esta definição inclui diversidade dentro da espécie, entre espécies e diversidade comparativa entre ecossistemas. Outra definição, mais desafiante, é "totalidade dos genes, espécies e ecossistemas de uma região". Esta definição unifica os três níveis tradicionais de diversidade entre seres vivos: 
* diversidade genética - diversidade dos genes em uma espécie; 
* diversidade de espécies - diversidade entre espécies; 
* diversidade de ecossistemas - diversidade em um nível mais alto de organização, incluindo todos os níveis de variação desde o genético.
